INSERT INTO `posts` VALUES (252, '1111111111111111111111111111111111111111111111111111', 'commun111is-claudeo-theca-1750936025611', 'Verus iste sortitus advenio acer appello beatus. Celebrer caveo optio.', 'hể các khu vực đêm 26/6 ngày 27/6, tại Hà Nội đôi lúc xuất hiện mưa rào và dông. Gió Đông Nam đến Nam ở cấp 2-3. Trong mưa dông có khả năng xảy ra các hiện tượng thời tiết cực đoan như lốc, sét và gió giật mạnh. Nhiệt độ thấp nhất từ 26-28 độ C, nhiệt độ cao nhất dao động từ 32-34 độ C.\n\nPhía Tây Bắc Bộ có mưa rào và dông rải rác, một số nơi có mưa to; riêng khu vực Tây Bắc có mưa vừa, mưa to và rải rác có dông, cục bộ có nơi mưa rất to, tập trung vào chiều tối và đêm. Trong cơn dông có khả năng xuất hiện lốc, sét, mưa đá và gió giật mạnh. Nhiệt độ thấp nhất từ 23-26 độ C, có nơi dưới 22 độ C. Nhiệt độ cao nhất từ 31-34 độ C, có nơi trên 34 độ; riêng khu Tây Bắc ở mức 28-31 độ C.\nPhía Đông Bắc Bộ có mưa rào và dông rải rác, một vài nơi có mưa to; riêng khu vực Việt Bắc có mưa vừa, mưa to và rải rác có dông, cục bộ có nơi mưa rất to, mưa tập trung vào chiều tối và đêm. Gió Đông Nam đến Nam cấp 2-3. Trong cơn dông có khả năng xảy ra lốc, sét, mưa đá và gió giật mạnh. Nhiệt độ thấp nhất từ 25-28 độ C, có nơi dưới 24 độ C. Nhiệt độ cao nhất trong khoảng 31-34 độ C.\n\nKhu vực từ Thanh Hóa đến Huế, chiều tối và đêm có mưa rào và dông vài nơi. Riêng vùng núi phía Tây từ Thanh Hóa đến Nghệ An có nơi mưa to; ban ngày trời nắng, có nơi xảy ra nắng nóng. Gió nhẹ. Trong mưa dông có khả năng xuất hiện lốc, sét và gió giật mạnh. Nhiệt độ thấp nhất từ 25-28 độ C, có nơi dưới 25 độ. Nhiệt độ cao nhất dao động từ 32-35 độ C, có nơi trên 35 độ.\nTừ Đà Nẵng đến Bình Thuận, chiều tối và đêm có mưa rào và dông vài nơi. Ban ngày trời nắng, khu vực phía Bắc có nơi xảy ra nắng nóng. Gió Tây Nam cấp 2-3. Trong mưa dông có khả năng xuất hiện lốc, sét và gió giật mạnh. Nhiệt độ thấp nhất từ 24-27 độ C. Nhiệt độ cao nhất trong khoảng 32-35 độ C.\nTây Nguyên có mưa rào và dông vài nơi. Riêng tối nay và chiều tối mai có mưa rào và dông rải rác, cục bộ có nơi mưa to. Gió Tây Nam cấp 2-3. Trong mưa dông có khả năng xảy ra lốc, sét và gió giật mạnh. Nhiệt độ thấp nhất từ 21-24 độ C. Nhiệt độ cao nhất từ 27-30 độ C.\nKhu vực Nam Bộ có mưa rào và dông vài nơi. Riêng tối nay và chiều tối mai có mưa rào và dông rải rác, cục bộ có nơi mưa to. Gió Tây Nam cấp 2-3. Trong mưa dông có khả năng xảy ra lốc, sét và gió giật mạnh. Nhiệt độ thấp nhất từ 24-27 độ C. Nhiệt độ cao nhất trong khoảng 30-33 độ C.', '2025-06-26 11:07:05', '2025-06-26 11:07:05', '2025-06-26 11:30:47');
